A Cow's Life - 2011
Emmanuel Gras
61 minutes
Documentary

Synopsis :

In the fields, we see them, extended on the grass or grazing peacefully. Large placid beasts that we thought we knew because they are livestock. Lions, gorillas, bears have our attention, but has anyone ever really looked at the cows? Has asked what they were doing with their days? What do they do when a storm passes? When the sun comes back? What do they think when they stand motionless, seemingly contemplating the void? But, in fact, do they think? The rhythm of the animal, in the middle of a herd, &quot;Bovines&quot; chronicles the life of cows, true.

